import React from "react";
import "./Board.css";
import PostBox from "./postBox";
//PostBox를 그려줍니다.
function PostList({ ref, postList, seedetial, goBack }) {
  console.log(postList);
  return (
    <div className="list">
      {postList[0] &&
        postList[0].map((post, idx) => (
          <React.Fragment key={idx}>
            {postList[0].length - 1 == idx}
            <PostBox idx={idx} ref={ref} postList={post} key={`calendar-week-${post.id}`} seedetail={seedetial} goBack={goBack} />
            <PostBox postList={post} key={`calendar-week-${post.id}`} seedetail={seedetial} goBack={goBack} />
          </React.Fragment>
        ))}
    </div>
  );
}
export default PostList;
